                <div className="collapse navbar-collapse"> 
            <div className="rech form-inline my-2 my-lg-0">
                <input className="form-control  mr-sm-2" type="search" ref="query" placeholder="Que recherchez vous ?" size="45"/>
                <button className="valideButton btn" onClick={() => this.request()} >C'est parti !</button>
            </div>
            </div>
            </div>   
        )
    }
}

export default NavBar;
